    data: |
      SELECT ALL * FROM tab0 (FORMAT parquet) AS cor0 WHERE col0 NOT BETWEEN ( - 9 ) + 31 + - col1 + + col0 AND col2 * 93;
  - name: tab0

outputs:
  - name: q13049.out
    data: |
      87	21	10
      97	1	99
